pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract NFTbase is ERC721 {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    struct NFTasset {
        string title;
        string desc;
        string tokenIds;
        address creator;
    }

    NFTasset[] private nftassets;

    mapping(uint256 => NFTasset) assetInfo;

    constructor() public ERC721("NFTbase", "NFTBASE") {}

    function addAsset(
        address account,
        string memory tokenURI,
        string memory title,
        string memory desc
    ) public returns (uint256) {
        _tokenIds.increment();

        uint256 newItemId = _tokenIds.current();
        _mint(account, newItemId);
        _setTokenURI(newItemId, tokenURI);
        NFTasset memory _nftasset = NFTasset(title, desc, tokenURI, account);
        assetInfo[newItemId] = _nftasset;

        return newItemId;
    }
}
